  false,\n\t\"url\": null,\n\t\"notes\": \"The Ernest F. Hollings Ace Basin NWR Habitat
  Management Plan provides a long-term vision and specific guidance on managing habitats
  for the resources of concern at Ernest F. Hollings Ace Basin NWR, to facilitate
  continuity in management programs. Refuge background, resources of concern, and
  habitat management goals and objectives are discussed. Management strategies and
  prescriptions then identify how and the specific means by which management and monitoring
  strategies will be implemented. Appendices follow.\",\n\t\"license_title\": \"License
